import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; 
import Login from "./routes/Login";
import Signup from "./routes/Signup";
import Home from "./routes/Home";
import EmailVerification from "./routes/EmailVerification";
import Completed from "./routes/Completed";
import ProfileEdit from "./routes/ProfileEdit";
import Scrap from "./routes/Scrap";
/*import MyPost from "./routes/MyPost";*/
import MyPerformances from './routes/MyPerformances';
import MyReservations from './routes/MyReservations';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/EmailVerification" element={<EmailVerification />} />
        <Route path="/Completed" element={<Completed />} />
        <Route path="/profile/edit/:user_id" element={<ProfileEdit />} />
        <Route path="/scrap/:user_id" element={<Scrap />} />
        <Route path="/myperformances/:user_id" element={<MyPerformances />} />
        <Route path="/myreservations/:user_id" element={<MyReservations />} />
      </Routes>
    </Router>
  );
}

export default App;



